import React, { Component } from "react";

import "../assets/scss/landing.scss";

export default class Landing extends React.Component {
  state = {};
  componentDidMount() {}

  render() {
    return (
      <div className="uniu-logo">
        <a href="/" className="uniu-logo">
          <img
            alt="UniU logo"
            src={require("../assets/img/app-icon-rounded.png")}
          />
        </a>
      </div>
    );
  }
}
